import React,{ useState,useEffect }  from 'react';

import FullCalendar from '@fullcalendar/react'
import dayGridPlugin from '@fullcalendar/daygrid'

const Modal = () => {
    const [selectedSlot, setSelectedSlot] = useState(null);
  const [userName, setUserName] = useState('venkatesh');
  const [userEmail, setUserEmail] = useState('venaktesh@gmail.com');
  const [meetingOption, setMeetingOption] = useState('googlemeet');

  const handleSlotSelect = (info) => {
    setSelectedSlot(info.startStr);
  };

  const handleFormSubmit = (e) => {
    e.preventDefault();
    // Perform any necessary form submission or data handling here
    console.log('Name:', userName);
    console.log('Email:', userEmail);
    console.log('Meeting Option:', meetingOption);
    console.log('Selected Slot:', selectedSlot);
    // Close the modal or perform any additional actions as needed
  };
  useEffect(() => {
    const calendarEl = document.getElementById('calendar');
    new FullCalendar.Calendar(calendarEl, {
      plugins: [dayGridPlugin],
      initialView: 'dayGridMonth',
      dateClick: handleSlotSelect,
    }).render();
  }, []);
    return (

<div class="modal fade" id="hireModal" data-bs-backdrop="static" data-bs-keyboard="false" tabindex="-1" aria-labelledby="hireModalLabel" aria-hidden="true">
  <div class="modal-dialog">
    <div class="modal-content">
      <div class="modal-header">
         <h5 className="modal-title" id="hireModalLabel">Hire Me</h5>
        <button type="button" className="close" data-dismiss="modal" aria-label="Close">
          <span aria-hidden="true">&times;</span>
        </button>  
        </div>
      <div class="modal-body">
        <div className="modal-body">
        {selectedSlot ? (
          <div>
            <p>Selected Slot: {selectedSlot}</p>
            <form onSubmit={handleFormSubmit}>
              <div className="form-group">
                <label htmlFor="userName">Name</label>
                <input type="text" className="form-control" id="userName" value={userName} onChange={(e) => setUserName(e.target.value)} required />
              </div>
              <div className="form-group">
                <label htmlFor="userEmail">Email</label>
                <input type="email" className="form-control" id="userEmail" value={userEmail} onChange={(e) => setUserEmail(e.target.value)} required />
              </div>
              <div className="form-group">
                <label>Meeting Option</label>
                <div className="form-check">
                  <input type="radio" className="form-check-input" id="googleMeet" name="meetingOption" value="googleMeet" checked={meetingOption === 'googleMeet'} onChange={() => setMeetingOption('googleMeet')} />
                  <label className="form-check-label" htmlFor="googleMeet">Google Meet</label>
                </div>
                <div className="form-check">
                  <input type="radio" className="form-check-input" id="phoneCall" name="meetingOption" value="phoneCall" checked={meetingOption === 'phoneCall'} onChange={() => setMeetingOption('phoneCall')} />
                  <label className="form-check-label" htmlFor="phoneCall">Phone Call</label>
                </div>
              </div>
              <button type="submit" className="btn btn-primary">Confirm</button>
            </form>
          </div>
        ) : (
          <FullCalendar
            plugins={[dayGridPlugin]}
            initialView="dayGridMonth"
            dateClick={handleSlotSelect}
          />
        )}
      </div>
      </div>
      <div class="modal-footer">
        <button type="button" class="btn btn-secondary" data-bs-dismiss="modal">Close</button>
        <button type="button" class="btn btn-primary">Understood</button>
      </div>
    </div>
  </div>
</div>


    )
}
export default Modal
